import React from "react";
import './sign-up-form.css'; // Reuse your existing styles

const WelcomePage: React.FC<{ onLogout: () => void }> = ({ onLogout }) => {
  return (
    <div className="signup-form-wrapper">
      <h2 className="signup-title">Welcome to the application.</h2>
      <div className="signup-form">
        <p style={{ fontSize: "1rem", textAlign: "center", marginBottom: "20px", color: "#333" }}>
          You have successfully signed in.
        </p>
        <button onClick={onLogout}>Logout</button>
      </div>
    </div>
  );
};

export default WelcomePage;
